import React from 'react'


export default class PersonList extends React.Component {

  edituser = event => {
    console.log(event);
  }

  deleteuser = event => {
    console.log(event);
  }

  render() {
    return (
      <table>
    <thead>
      <tr>
        <th>Name</th>
        <th>Username</th>
        <th>Actions</th>
      </tr>
    </thead>
    <tbody>
      <tr>
        <td>Name data</td>
        <td>Username data</td>
        <td>
          <button className="button muted-button" onClick={this.edituser}>Edit</button>
          <button className="button muted-button" onClick={this.deleteuser}>Delete</button>
        </td>
      </tr>
    </tbody>
  </table>
    )
  }
}
